export const OpenMultiFileDiffRequest: MessageFns<OpenMultiFileDiffRequest> = {
	encode(
		message: OpenMultiFileDiffRequest,
		writer: BinaryWriter = new BinaryWriter(),
	): BinaryWriter {
		if (message.title !== undefined) {
			writer.uint32(10).string(message.title);
		}
		for (const v of message.diffs) {
			ContentDiff.encode(v!, writer.uint32(18).fork()).join();
		}
		return writer;
	},

	decode(
		input: BinaryReader | Uint8Array,
		length?: number,
	): OpenMultiFileDiffRequest {
		const reader =
			input instanceof BinaryReader ? input : new BinaryReader(input);
		const end = length === undefined ? reader.len : reader.pos + length;
		const message = createBaseOpenMultiFileDiffRequest();
		while (reader.pos < end) {
			const tag = reader.uint32();
			switch (tag >>> 3) {
				case 1: {
					if (tag !== 10) {
						break;
					}

					message.title = reader.string();
					continue;
				}
				case 2: {
					if (tag !== 18) {
						break;
					}

					message.diffs.push(ContentDiff.decode(reader, reader.uint32()));
					continue;
				}
			}
			if ((tag & 7) === 4 || tag === 0) {
				break;
			}
			reader.skip(tag & 7);
		}
		return message;
	},

	fromJSON(object: any): OpenMultiFileDiffRequest {
		return {
			title: isSet(object.title) ? globalThis.String(object.title) : undefined,
			diffs: globalThis.Array.isArray(object?.diffs)
				? object.diffs.map((e: any) => ContentDiff.fromJSON(e))
				: [],
		};
	},

	toJSON(message: OpenMultiFileDiffRequest): unknown {
		const obj: any = {};
		if (message.title !== undefined) {
			obj.title = message.title;
		}
		if (message.diffs?.length) {
			obj.diffs = message.diffs.map((e) => ContentDiff.toJSON(e));
		}
		return obj;
	},

	create(
		base?: DeepPartial<OpenMultiFileDiffRequest>,
	): OpenMultiFileDiffRequest {
		return OpenMultiFileDiffRequest.fromPartial(base ?? {});
	},
	fromPartial(
		object: DeepPartial<OpenMultiFileDiffRequest>,
	): OpenMultiFileDiffRequest {
		const message = createBaseOpenMultiFileDiffRequest();
		message.title = object.title ?? undefined;
		message.diffs = object.diffs?.map((e) => ContentDiff.fromPartial(e)) || [];
		return message;
	},
};

